    tested = [0] * n
    interesting = [0] * n
    ans = 0
    while len(a) != 0:
        m = min(a[:k])
        for j in range(m):
            for i in range(min(k, len(a))):
                tested[i] += 1
                a[i] -= 1
                if caption != 1:
                    if tested[i] == caption:
                        interesting[i] = 1
        i = 0
        while i < min(k, len(a)):
            if a[i] == 0:
                if interesting[i] == 1:
                    ans += 1
                del interesting[i]
                del a[i]
                del tested[i]
                i -= 1
            i += 1
        caption = int(100 * (n - len(a)) / n + 0.5)
    return ans

